import './App.css';
import NavBar from './NavBar'
import AllRoutes from './AllRoutes';
import {BrowserRouter} from 'react-router-dom';
import background from './static/background.png';

function App() {
  return (
    <BrowserRouter>
      <div className="App" style={{ 
      backgroundImage: `url(${background})` 
    }}>
        <NavBar/>
        <AllRoutes/>
        <span><a href="https://www.freepik.com/free-vector/abstract-connections-background_1894940.htm">Image by kjpargeter</a> on Freepik</span>
      </div>
    </BrowserRouter>
  );
}

export default App;
